import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Button from 'react-bootstrap/Button';
import { Link } from 'react-router-dom'; // Assuming you're using React Router for navigation

function CustomNavbar({ user, onLogout }) {
  return (
    <Navbar bg="primary" expand="lg" variant="dark">
      <Navbar.Brand as={Link} to="/">Your App Name</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link as={Link} to="/">Home</Nav.Link>
          {user ? (
            <>
              {user.role === 'patient' && (
                <Nav.Link as={Link} to="/patient">Patient Page</Nav.Link>
              )}
              {user.role === 'doctor' && (
                <Nav.Link as={Link} to="/doctor">Doctor Page</Nav.Link>
              )}
              {user.role === 'admin' && (
                <Nav.Link as={Link} to="/admin">Admin Page</Nav.Link>
              )}
            </>
          ) : null}
        </Nav>
        {user ? (
          <>
            <Navbar.Text>Signed in as {user.name}</Navbar.Text>
            <Button variant="outline-light" onClick={onLogout}>Logout</Button>
          </>
        ) : (
          <Button variant="outline-light" as={Link} to="/login">Login</Button>
        )}
      </Navbar.Collapse>
    </Navbar>
  );
}

export default CustomNavbar;
